package main

import (
	"fmt"
)

func main() {
	fmt.Printf("Final Floor is: %d\n", Count(input()))
}

func Count(x string) int {
	total := 0
	for _, runeValue := range x {
		strVal := string(runeValue)
		if strVal == "(" {
			total++
		} else if strVal == ")" {
			total--
		}
	}
	return total
}

